import React from 'react';
import { Navbar, Container, Nav } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const NavBar = ({ selectSection }) => {
  const styles = {
    brand: {
      fontSize: '2rem',
      color: '#fff',
      textDecoration: 'none',
    },
  };

  return (
    <Navbar variant='dark' expand='lg'>
      <Container>
        <Navbar.Brand
          as={Link}
          to='/'
          onClick={() => {
            selectSection('About Me');
          }}
          style={styles.brand}
        >
          Steve Martin
        </Navbar.Brand>
        <Navbar.Toggle aria-controls='basic-navbar-nav' />
        <Navbar.Collapse id='basic-navbar-nav' className='flex-grow-0'>
          <Nav className='me-auto'>
            <Nav.Link
              as={Link}
              to='/'
              onClick={() => {
                selectSection('About Me');
              }}
              style={styles.brand}
            >
              About Me
            </Nav.Link>
            <Nav.Link
              as={Link}
              to='/projects'
              onClick={() => {
                selectSection('Projects');
              }}
              style={styles.brand}
            >
              Projects
            </Nav.Link>
            <Nav.Link
              as={Link}
              to='/contact'
              onClick={() => {
                selectSection('Contact');
              }}
              style={styles.brand}
            >
              Contact
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default NavBar;
